import React from 'react'
import { useDispatch, useSelector } from 'react-redux';

const Wallet = () => {
	const {userInfo} = useSelector(state => state.auth)
	return (
		<div>
			Wallet component works!
			{userInfo&&userInfo.name}
		</div>
	)
}

export default Wallet
